Job_Description:
have 8+ years experience in complex data management scenarios;
have a huge interest in the business processes and business challenges a company like Metro is facing; experience in the wholesale/retail domain is a plus but not mandatory;
have coded data processing pipelines or data applications and should be knowledgeable in modern software delivery and lifecycle management;
have deep knowledge in state of the art data processing technologies;
deep knowledge (differences and tradeoffs) of different database technologies, like Relational, NoSQL, Data Lake;
good knowledge of public clouds (GCP);
have a consulting mindset. Sharing information and proactively support projects is a must;
should be able to guide and respecting people and be an internal sales person for all topics around data;
should have skills in data modeling and governance models and how to make them become reality in a large cooperation;
should have strong methodology skills when engaging with business units and data teams;
should have a background in how to bring AI/ML into business processes and what role data management plays in such advanced solutions;
should have knowledge in the area of GDPR and other data privacy and security regulations;
